@Component({
  selector: 'app-mydevices',
  templateUrl: './mydevices.component.html',
  styleUrls: ['./mydevices.component.css']
})
export class MydevicesComponent {
  caja: any;

  constructor(private _gvc: GeneralviewServiceService) {}
}
